import React from 'react'
import {useNavigate} from 'react-router-dom';

const AdminHomePage  = () => {
  const navigate = useNavigate();
  return (
    <div id='adminNavbar'>
        <nav>
    <a href='#' className='logo'>Strafe</a>
    <div className='element'>
      <a id='adminProductButton' onClick={()=> navigate("products") } className='element'>Products</a>
      <a id='adminOrderButton' onClick={()=> navigate("viewOrders") } className='element'>Orders</a>
      <a id='adminOrderButton' onClick={()=> navigate("users") } className='element'>Users</a>
    </div>
    <a id='logout' className='#' className='logout'>Log out</a>
  </nav>
  <div>Hello Shubham</div>
    </div>
  )
}

export default AdminHomePage
